let ll_len = lls.length
var start = new Date(lls[ll_len - 1][2] / 1000000);
var end = new Date(lls[0][2] / 1000000);
let i = 0;
var max_sqkm = 0

for (i = 0; i < lls.length; i++) {
	let sqkm = lls[i][4]
	if (sqkm > max_sqkm) {
		max_sqkm = sqkm
	}
}

var info = L.control();

info.onAdd = function(map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function(date) {
	if (date) {
		let day = date.getDate();
	let month = date.getMonth()
	let year = date.getFullYear();
	let monthNames = ["January", "February", "March", "April", "May", "June", "July",
	"August", "September", "October", "November", "December"];
	let html = '<h3>' + monthNames[month] + "-" + day + "-" + year + '</h3>'
	this._div.innerHTML = "<div style='width:" + 170+ "px;height:" + 25 + "px;overflow:hidden;display:block;padding:0;border:0;margin:0'>" + html + "</div>";
	}
};

info.addTo(map);

function animation_loop() {
	info.update(start)
    plotMarkers(start);
    setTimeout(function() {
    	let newDate = start.setDate(start.getDate() + 1);
    	start = new Date(newDate);
    	if (start < end) {
    		animation_loop();
    	}
    }, 1);
};
animation_loop();

function plotMarkers(startDate) {
  let startD = startDate.getDate();
  let startMonth = startDate.getMonth();
  let startYear = startDate.getFullYear();
  let date_name = ".id-" + startMonth + "-" + startD + "-" + startYear
  console.log(date_name);
  expireMarkers(".id-" + startMonth + "-" + startD + "-" + startYear)
	let i = lls.length - 1
	for (i = lls.length - 1; i > 0; i--) {
		let llDate = new Date(lls[i][2] / 1000000)
		let d = llDate.getDate();
		let month = llDate.getMonth()
		let year = llDate.getFullYear();
		let endDate = new Date(lls[i][3]/ 1000000)
		let endDay = endDate.getDate();
		let endMonth = endDate.getMonth();
		let endYear = endDate.getFullYear();
		let endStamp = endMonth + "-" + endDay + "-" + endYear
    console.log(endStamp)
		if ((d == startD) && (month == startMonth) && (year == startYear)) {
			let className = "animated-icon id-" + endStamp;
			const icon = L.divIcon({
	    		iconSize: [5, 5],
	    		iconAnchor: [10, 10],
    			popupAnchor: [10, 0],
    			shadowSize: [0, 0],
    			className: className
			})
			var ll = L.latLng(lls[i][0], lls[i][1])
			// create marker
			var marker = L.marker(ll, {
  				icon: icon,
  				title: 'title!'
			})
			let name = ".id-" + endStamp
			let sqkm = lls[i][4]
			let normalized_size = (2 * (sqkm / max_sqkm) * 50) + 5;
			let normalized_pixels = normalized_size + 'px'
			marker.addTo(map, setTimeout(function(){
				let icons = document.querySelectorAll(name)
        if (icons.length > 0) {
      		let i = 0;
      		for (i = 0; i < icons.length; i++) {
            icons[i].style.width = normalized_pixels;
      			icons[i].style.height = normalized_pixels;
            icons[i].style.marginLeft = 'auto'
            icons[i].style.marginTop = 'auto'
      			icons[i].style.backgroundColor = 'rgba(255, 48, 44, 0.9)'
      		}
  			}}, 0))
		} else if (llDate < startDate) {
			continue;
		} else {
      break;
		}
	}
}

function expireMarkers(name) {
	let icons = document.querySelectorAll(name)
	if (icons.length > 0) {
		let i = 0;
		for (i = 0; i < icons.length; i++) {
			icons[i].style.backgroundColor = 'rgba(192,192,192,0.7)'
      icons[i].style.width = '5px';
      icons[i].style.height = '5px';
		}
	}
}
